import React from 'react';

const Movie = (props) => {
    return (
				<div class="entryData">
                    {props.title}
					<div class="entryTopic">
						{props.event}
					</div>
					<div class="entryPeriod">
						{props.takes_place}
					</div>
					<div class="entryLocation">
						{props.theatre}
					</div>
					<div class="entryLength">
						{props.length}
					</div>
					<div class="entryLanguage">
						{props.audio}
					</div>
					<div class="entryAwards">
						{props.awards}
					</div>
					<div class="entryAvailability">
						{props.availability}
					</div>
			    </div>
    )
}

export default Movie;
